// import logo from './logo.svg';
import './App.css';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import EmpListing from './Components/EmpListing.js';
import ContactCreate from './Components/ContactCreate.js';
import ContactDetails from './Components/ContactDetails.js';
import ContactEdit from './Components/ContactEdit.js';

function App() {
  return (
    <div className="App">
        <h4>React JS Contact Details</h4>
        <BrowserRouter>
          <Routes>
            <Route path="/" element={<EmpListing />}></Route>
            <Route path="/contacts/create" element={<ContactCreate />}></Route>
            <Route path="/contacts/edi/" element={<ContactEdit />}></Route>
            <Route path="/contacts/details" element={<ContactDetails/>}></Route>
          </Routes>
          </BrowserRouter>
    </div>
  );
}

export default App;
